import { useHistory } from "react-router-dom";
const Legends = () => {
return (
    <div className="legend">
        <h1 font={24} style={{marginTop:"-15rem"}}>Legendă</h1>
        <card>
                <div className="card position-absolute top-50 start-0 translate-middle" style={{width:"40em", height:"45rem",marginTop:"0rem",marginLeft:"21rem"}}>
                    <div className="card-body">
                        <h2 style={{textAlign:"center"}} font={12}>Legenda începutului zborului</h2>
                    </div>
                </div>
            </card>
    </div>
);
}
export default Legends;
